	(55, '5d97cae6a7c4693372dd9c39', 186, 12, 'The contrast between Mellody Farm and the Elizabethan-style Ardleigh, designed in 1896 for the John V. Farwell Jr. family, showcases Heun’s range.', 2, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
