	(57, '5d97cae6a7c4693372dd9c3d', 188, 12, 'Those connections could be both familial or business. While Mellody Farm was still under construction just up Waukegan Road, Arthur Heun also designed a gentleman farm for J. Ogden Armour’s Armour & Co. colleague, Arther Meeker, near the corner of Waukegan and Kennedy roads. Arcady Farm is pictured here in 1962.', 6, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
