	(876, '5da8f3b28303b310c1d6e623', 1113, 104, 'The 1896 Ferry Hall women’s basketball team.', 0, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
	(877, '5da8f3b28303b310c1d6e625', 1114, 104, 'The first two games took place at Mitchell Hall’s home court, the Gymnasium, now Hotchkiss Hall. Mitchell Hall refused to play in Ferry Hall’s gym, citing the unfit playing conditions: the Ferry Hall gym ceilings were too low for regulation baskets, and a row of posts ran through the center of the court.', 2, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
	(878, '5da8f3b28303b310c1d6e627', 1115, 104, 'Ferry Hall’s inadequate gymnasium conditions for basketball is probably why the team began practicing on the “basket ball field” outdoors, pictured here in one of the school’s viewbooks.', 4, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
