	(899, '5db755cfeb24173a5bf1538b', 1138, 11, 'Arcady Farm, designed for the Meekers in 1906 by architect Arthur Heun, was located on the northwest corner of Waukegan Road and Rte. 60 and included an extensive dairy that sold the first certified milk in the state. Image source: Bess Bower Dunn Museum.', 2, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
	(900, '5db7d7f2eb24173a5bf1539f', 1144, 106, 'Knollwood’s first clubhouse consisted of two farmhouses combined together. The Granger Farwell farmhouse was moved and adjoined to the A.C. McCord house, which remained in its original location. Architect Howard Van Doren Shaw then added porches and a large reception room.', 0, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
