	(903, '5db7d7f2eb24173a5bf153a5', 1147, 106, 'Men\'s locker room (1926) interior.', 6, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
	(904, '5db7d7f2eb24173a5bf153a6', 1148, 106, 'In September 1956, Knollwood played host to the 56th U.S. Men’s Amateur. Harve Ward won the tournament, defeating Ken Venturi in early rounds of match play and Charles Kocsis for the title. Pictured are Kocsis (putting) and Ward (looking on at left) during the second 18 holes of the final match.', 7, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
	(905, '5db7d7f2eb24173a5bf153a8', 2635, 106, '', 5, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
