	(935, '5db8a1c7eb24173a5bf154c1', 1326, 108, 'The Lake Forest Golf Club converted one of Leander McCormick’s outbuildings, alternately a “sheep shed” or “chicken coop” depending on the account, for use as its single-chamber locker room.', 0, '', '2023-01-26 21:07:44', '2023-01-26 21:07:44'),
